local function toggleBar(focus)
	visible = not visible
	if visible then
		box.Visible = true
		if focus then
			box:CaptureFocus()
		end
	else
		box.Visible = false
		box:ReleaseFocus()
	end
end

local function toggleMain()
	main.Visible = visible
end

